Login with passport for social logs user into the same account<p>I'm trying to implement login with social media (FB and Google) alongside a local strategy.  I have passport-local working fine (other than duplicate emails are allowed but separate question) but I am seeing some strange behavior with the Facebook and Google strategies.  Here is a scenario:</p>

<ol>
<li>Log in with Facebook or Google</li>
<li>Sign out</li>
<li>Log in with the opposite of whichever the initial log in was (i.e. first FB, second Google)</li>
<li>The app logs in with the initial account rather than the second.</li>
</ol>

<p>I followed the tutorial on this page for setting up the various strategies</p>

<p><a href="http://mherman.org/blog/2013/11/10/social-authentication-with-passport-dot-js/#.Wk93wN-nFPb" rel="nofollow noreferrer">http://mherman.org/blog/2013/11/10/social-authentication-with-passport-dot-js/#.Wk93wN-nFPb</a></p>

<p>Example of a strategy:</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>passport.use(new googleStrategy({
    clientID: config.google.clientID,
    clientSecret: config.google.clientSecret,
    callbackURL: config.google.callbackURL,
    scope: ['profile', 'email'],
    passReqToCallback: true
},
    (request, accessToken, refreshToken, profile, done) =&gt; {

        var emailArray = new Array();

        profile.emails.forEach((email) =&gt; {
            emailArray.push(email.value);
        })

        User.findOne({ $or: [{ oauthID: profile.id }, { email: { $in: [emailArray] } }] }, (err, user) =&gt; {
            if (err) {
                console.log(err);
            }
            if (!err &amp;&amp; user !== null) {
                console.log('Already existing user:' + user);
                done(null, user);

            } else {
                console.log('Creating a new user');
                user = new User({
                    email: emailArray[0],
                    username: profile.name.givenName,
                    oauthID: profile.id
                });
                user.save(function (err) {
                    if (err) {
                        console.log(err);
                    } else {
                        done(null, user);
                    }
                });
            }
        });
    }
));

passport.serializeUser(User.serializeUser());
passport.deserializeUser(User.deserializeUser());</code></pre>
</div>
</div>
</p>

<p>The User MongoDB model</p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>var mongoose = require('mongoose'),
    passportLocalMongoose = require('passport-local-mongoose');

var userSchema = new mongoose.Schema({
    email: String,
    username: String,
    password: String,
    oauthID: Number
});

userSchema.plugin(passportLocalMongoose);

module.exports = mongoose.model('User', userSchema);</code></pre>
</div>
</div>
</p>

<p>And the auth routes </p>

<p><div class="snippet" data-lang="js" data-hide="false" data-console="true" data-babel="false">
<div class="snippet-code">
<pre class="snippet-code-js lang-js prettyprint-override"><code>router.get('/auth/google',
    passport.authenticate('google'), (req, res) =&gt; {
        console.log('Authenticating as: ' + req.user.email + ', oAuthID: ' + req.user.oauthID);
    });

router.get('/auth/google/callback',
    passport.authenticate('google', { failureRedirect: '/auth' }), (req, res) =&gt; {
        console.log('Authenticated as: ' + req.user.email + ', oAuthID: ' + req.user.oauthID);
        res.redirect('/');
    });</code></pre>
</div>
</div>
</p>

<p>The Facebook strategy is basically the same.</p>

<p>My first thought was that the <code>User.findOne()</code> query was incorrect but if I enter the query into the Mongo console I receive the expected result.</p>

<p>Next I put logging in to see what the value of <code>req.user</code> was at various points of the authentication process. Every step looks normal except that they ultimately get logged into the account that they originally logged in with.</p>

<p>So I'm not sure where the issue lies...I'm pretty new to web development so any help is / explanations are very appreciated.</p>

